import React, { Component } from "react";
import { Container } from "react-bootstrap";
import { Link } from "react-bootstrap";
import "./Menu.css";
class Menu extends Component {
  render() {
    return (
      <>
        <Container>
          <ul className="super-links">
            <Link>MOBILE PHONE</Link>
            <Link>LAPTOPS & DESKTOP</Link>
            <Link>TVS & PROJECTORS</Link>
            <Link>ACCESSORIES</Link>
            <Link>PRINTER</Link>
            <Link>SPEAKERS</Link>
            <Link>FASHION</Link>
            <Link>Baby Product</Link>
          </ul>
        </Container>
      </>
    );
  }
}

export default Menu;
